import React from "react";
import Navbarprofile from "../../Components/Navbarprofile/Navbarprofile";
import Navprofile from "../../Components/navprofile/Navprofile";
import PropTypes from "prop-types";
import Button from "@mui/material/Button";
import { styled } from "@mui/material/styles";
import Dialog from "@mui/material/Dialog";
import DialogTitle from "@mui/material/DialogTitle";
import DialogContent from "@mui/material/DialogContent";
import DialogActions from "@mui/material/DialogActions";
import IconButton from "@mui/material/IconButton";
import CloseIcon from "@mui/icons-material/Close";
import Typography from "@mui/material/Typography";
import Tabpanell from "../../Components/Tabpanel/Tabpanell";
import EditIcon from "@mui/icons-material/Edit";
import { useState } from "react";
import { makeStyles } from "@mui/styles";
import { Input } from "@mui/material";
import DialogContentText from "@mui/material/DialogContentText";
import TextField from "@mui/material/TextField";

import {
  MDBCol,
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBBtn,
  MDBTypography,
  MDBCardText,
} from "mdb-react-ui-kit";
import { Grid } from "@mui/material";
import Slice from "../../Components/Modifyprofileslice/Slice";
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": {
    padding: theme.spacing(2),
  },
  "& .MuiDialogActions-root": {
    padding: theme.spacing(1),
  },
}));
const useStyles = makeStyles((theme) => ({
  photoContainer: {
    display: "flex",
    alignItems: "center",
    justifyContent: "center",
    height: "120px",
    width: "120px",
    border: "1px solid black",
    cursor: "pointer",
  },
  photo: {
    height: "100%",
    width: "100%",
    objectFit: "contain",
  },
}));
const useStyless = makeStyles({
  root: {
    "& label.Mui-focused": {
      color: "#810CA8",
    },
    "& .MuiInput-underline:after": {
      borderBottomColor: "#810CA8",
    },
    "& .MuiOutlinedInput-root:hover .MuiOutlinedInput-notchedOutline": {
      borderColor: "#810CA8",
    },
  },
});

const Profile = () => {
  const [open, setOpen] = React.useState(false);

  const handleClickOpen = () => {
    setOpen(true);
  };
  const handleClose = () => {
    setOpen(false);
  };
  const classes = useStyles();
  const [photo, setPhoto] = useState(null);

  const handlePhotoChange = (event) => {
    const file = event.target.files[0];
    const reader = new FileReader();
    reader.onload = (e) => {
      setPhoto(e.target.result);
    };
    reader.readAsDataURL(file);
  };

  const handlePhotoClick = () => {
    if (photo) {
      window.open(photo);
    }
  };
  const [openusername, setOpenusername] = React.useState(false);
  function BootstrapDialogTitle1(props) {
    const { children, onClosee, ...other } = props;
    BootstrapDialogTitle1.propTypes = {
      children: PropTypes.node,
      onClose: PropTypes.func.isRequired,
    };
    return (
      <DialogTitle sx={{ m: 0, p: 2 }} {...other}>
        {children}
        {onClosee ? (
          <IconButton
            aria-label="close"
            onClick={onClosee}
            sx={{
              position: "absolute",
              right: 8,
              top: 8,
              color: "#2D033B",
            }}
          >
            <CloseIcon />
          </IconButton>
        ) : null}
      </DialogTitle>
    );
  }
  const handleClickOpenusername = () => {
    setOpenusername(true);
  };

  const handleCloseusername = () => {
    setOpenusername(false);
  };

  const classesusername = useStyless();

  return (
    <div
      style={{
        // backgroundColor: "red",
        display: "flex",
        justifyItems: "column",
        width: "100%",
      }}
    >
      <div
        style={{
          // backgroundColor: "yellow",
          display: "inline-block",
          position: "sticky",
          top: 0,
          height: "100%",
          //position: "fixed",
        }}
      >
        <Navprofile />
      </div>

      <div
        style={{
          // backgroundColor: "green",
          width: "100%",
          display: "flex",
          flexDirection: "column",
          justifyContent: "center",
          //alignItems: "center",
          // height: "500px",
        }}
      >
        <div
          style={{
            // backgroundColor: "blue",
            height: "65px",
            //position: "fixed",
            top: 0,
            //left: 0,
            right: 0,
            position: "sticky",
            width: "100%",
            zIndex: 2,
            //position: "fixed",
          }}
        >
          <Navbarprofile />
        </div>
        <div
          style={{
            zIndex: "0",
            // backgroundColor: "orange",
            display: "inline-block",

            // marginTop: "64px",
            // zIndex: "0",
            // height: "65px",
            // width: "1600px",
            //position: "fixed",
          }}
        >
          <MDBContainer className="py-5 h-100">
            <MDBRow className="justify-content-center align-items-center h-100">
              <MDBCol xl="12" lg="10" md="10" sm="10" xs="8">
                <MDBCard>
                  <div
                    className="rounded-top text-white d-flex flex-row"
                    style={{
                      // backgroundColor: "#000",
                      height: "300px",
                    }}
                  >
                    <div
                      className="ms-4 mt-5 "
                      style={{
                        width: "150px",
                        marginLeft: "20px",
                        //marginRight: "0px",
                        //backgroundColor: "green",
                        height: "200px",
                        display: "flex",
                        flexDirection: "column",
                        //alignContent: "center",
                        //alignItems: "center",
                        //justifyContent: "space-between",
                      }}
                    >
                      <MDBCardImage
                        src="https://i.pinimg.com/564x/e1/be/95/e1be95e26e853c491ff3a09e6b996783.jpg"
                        alt="Generic placeholder image"
                        className="img-thumbnail"
                        fluid
                        style={{ width: "150px", zIndex: "0" }}
                      />

                      <div
                        style={{
                          marginTop: "10px",
                          //backgroundColor: "red",
                          display: "flex",
                          // justifyContent: "row",
                          // alignContent: "center",
                          marginRight: "0px",
                          //margin: "0px",
                          width: "150px",
                          padding: "0px",
                        }}
                      >
                        <MDBBtn
                          className="mx-2"
                          color="light"
                          rippleColor="dark"
                          onClick={handleClickOpen}
                          style={{
                            height: "28px",
                            width: "135px",
                            fontSize: "18px",
                            // position: "fixed",
                            padding: "0px",
                            margin: "0px",
                            // zIndex: "0",
                            //textAlign: " right;",
                          }}
                        >
                          <div>Edit profile</div>
                        </MDBBtn>
                        <BootstrapDialog
                          onClose={handleClose}
                          aria-labelledby="customized-dialog-title"
                          open={open}
                          sx={{
                            boxShadow: "0 8px 32px rgba(31,28,135,0.37)",
                            backdropFilter: " blur(8.5px)",
                          }}
                        >
                          <BootstrapDialogTitle1
                            id="customized-dialog-title"
                            onClose={handleClose}
                            sx={{ color: "#2D033B" }}
                          >
                            Edit Profile
                          </BootstrapDialogTitle1>
                          <DialogContent dividers sx={{ width: "500px" }}>
                            <p style={{ color: "grey" }}>Profile photo</p>

                            <div
                              style={{
                                display: "flex",
                                justifyContent: "center",
                              }}
                            >
                              <div
                                className={classes.photoContainer}
                                onClick={handlePhotoClick}
                              >
                                {photo && (
                                  <img
                                    src={photo}
                                    alt="photo"
                                    className={classes.photo}
                                  />
                                )}
                              </div>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "center",
                                marginTop: "5px",
                              }}
                            >
                              <Button
                                variant="Text"
                                component="label"
                                color="secondary"
                                sx={{ mt: 2, mb: 2, color: "#810CA8" }}
                              >
                                Upload File
                                <input
                                  type="file"
                                  hidden
                                  onChange={handlePhotoChange}
                                />
                              </Button>
                            </div>
                            {/**********************************************************************************************/}
                            <p style={{ color: "grey" }}>
                              Personal information
                            </p>

                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Username</p>
                              <IconButton onClick={handleClickOpenusername}>
                                <EditIcon />
                              </IconButton>
                              <Dialog
                                open={openusername}
                                sx={
                                  {
                                    // boxShadow: "0 8px 32px rgba(31,28,135,0.37)",
                                    // backdropFilter: " blur(8.5px)",
                                  }
                                }
                              >
                                {/*<BootstrapDialogTitle1
                                  id="customized-dialog-title"
                                  onClose={handleCloseusername}
                                  sx={{ color: "#2D033B" }}
                                >
                                  username
                                </BootstrapDialogTitle1> */}
                                <DialogContent>
                                  <p>set a new username</p>
                                  <TextField
                                    autoFocus
                                    margin="dense"
                                    id="name"
                                    label="username"
                                    type="username"
                                    fullWidth
                                    variant="standard"
                                    className={classesusername.root}
                                  />
                                </DialogContent>
                                <DialogActions>
                                  <Button
                                    autoFocus
                                    onClick={handleCloseusername}
                                    sx={{ color: "#2D033B" }}
                                  >
                                    Save changes
                                  </Button>
                                </DialogActions>
                              </Dialog>
                            </div>

                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>First name</p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Last name</p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Email</p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Password</p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Town</p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>
                                Average Response Time
                              </p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                            <div
                              style={{
                                display: "flex",
                                justifyContent: "space-between",
                              }}
                            >
                              <p style={{ color: "black" }}>Description</p>
                              <IconButton>
                                <EditIcon />
                              </IconButton>
                            </div>
                          </DialogContent>
                          <DialogActions
                            sx={{ display: "flex", justifyContent: "row" }}
                          >
                            <Button
                              autoFocus
                              sx={{
                                color: "red",
                                marginRight: "200px",
                              }}
                            >
                              Delete Account
                            </Button>
                            <Button
                              autoFocus
                              onClick={handleClose}
                              sx={{ color: "#2D033B" }}
                            >
                              Save changes
                            </Button>
                          </DialogActions>
                        </BootstrapDialog>
                      </div>
                    </div>

                    <Grid
                      container
                      spacing={1}
                      //className="ms-3"
                      style={{
                        marginTop: "50px",
                        marginLeft: "50px",
                        //backgroundColor: "red",
                        display: "flex",

                        height: "180px",
                      }}
                    >
                      <Grid
                        xs={10}
                        sx={{
                          // backgroundColor: "green",
                          height: "40px",
                        }}
                      >
                        <MDBTypography
                          tag="div" // wrap the <p> elements in a <div> container
                          style={{
                            display: "flex", // use flexbox to align the <p> elements horizontally
                            margin: "0px",
                            flexDirection: "column", // vertically center the <p> elements
                            marginRight: "45px",
                            color: "#2D033B",
                            fontSize: "13px",
                          }}
                        >
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              //padding: "0px",
                              flexDirection: "row",
                            }}
                          >
                            <h2
                              style={{
                                color: "black",
                                fontSize: "18px",
                                marginBottom: "15px",
                                padding: "0px",
                              }}
                            >
                              {localStorage.getItem("username")}
                            </h2>
                          </div>

                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally

                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",
                                color: "#2D033B",
                                fontSize: "10px",
                                // marginRight: "10px",
                                margin: "0px",
                              }}
                            >
                              HOME ADRESS:
                            </p>
                            <p
                              style={{
                                color: "gray",
                                fontSize: "10px",
                                margin: "0px",
                                fontFamily: "sans-serif",
                              }}
                            >
                              {localStorage.getItem("homeAddress")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              marginRight: "10px",
                              margin: "0px",
                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",

                                color: "#2D033B",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              PHONE NUMBER:
                            </p>
                            <p
                              style={{
                                color: "gray",
                                fontSize: "10px",
                                fontFamily: "sans-serif",
                                margin: "0px",
                              }}
                            >
                              {localStorage.getItem("phone")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              //backgroundColor: "green",
                              flexDirection: "row",
                            }}
                          >
                            <p
                              style={{
                                marginRight: "10px",
                                color: "#2D033B",
                                fontSize: "10px",
                                margin: "0px",
                              }}
                            >
                              AVERAGE RESPONSE TIME:
                            </p>
                            <p
                              style={{
                                color: "gray",
                                fontSize: "10px",
                                margin: "0px",
                                fontFamily: "sans-serif",
                              }}
                            >
                              {localStorage.getItem("avgResponseTime")}
                            </p>
                          </div>
                          <br />
                          <div
                            style={{
                              display: "flex", // use flexbox to align the <p> elements horizontally
                              //backgroundColor: "red",
                              flexDirection: "row",
